Make me laugh and Ill love you. Ariel says with a smile. I love men who can make me laugh. Laughter is so important in life that if you cant just let go and laugh, what good is it. Did you hear the joke about the farmers daughter and... I mean, dont be foolish, be witty, be charming, be funny and I will be yours. So the farmers daughter and the salesman...I think, someone who can make you smile is more important then someone who can buy you diamonds or gold. Things fade, smiles and laughs never do, they stay in you forever. Wait.we forgot the punchline ... Really...we can be funny too...
